import React from "react";
import {BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import {Container} from "react-bootstrap";


function App() {
  return (
    <Container>
      <Router>
        <nav>
          <Link>Home</Link>
          <Link>Add</Link>
          <Link>List</Link>
          <Link>Log in</Link>
        </nav>
        <Routes>

        </Routes>
      </Router>
    </Container>
  );
}

export default App;
